function Series0D() {
    this.Show=function(state,matrix,item,skeys,colkey,colvalues,rowkey,rowvalues){
	console.log("Make 0D series.");
	// make header row
	var row = document.createElement("TR");
	this.appendDataRow0D(state,matrix,row);
	item.appendChild(row);
    }

    this.appendDataRow0D=function(state,matrix,row) {
	if (matrix[""] !== undefined && matrix[""][""] !== undefined) {
	    var range=state.Matrix.getRange(state,matrix,[""],[""]);
	    var element=matrix[""][""];
	    console.log("Range:",JSON.stringify(range));
	    if (element.cnt > 0) { // we have some data
		//console.log("Calling makeCanvas.",jj,key,values[jj]);
		row.appendChild(
		    state.Html.makeCanvasItem(state,element,range)
		);
	    }
	}
    }


};
